import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  header: {
    borderBottomWidth: 1,
    borderBottomColor: "#D8D8D8",
  },
  name: {
    marginBottom: 16,
  },
  title: {
    marginBottom: 56,
  },
});

export default styles;
